//Agrega los elementos al catalogo, verfica su stock, precio, nombre desde la base de datos del servidor
document.addEventListener("DOMContentLoaded", function () {
  var productosDB; //Almacena los productos devueltos por el fetch
  var cargaInicial = 9; //Cantidad de elementos que intenta cargar el catalogo apenas se carga la pagina
  var elementosCargados = 0; //Lleva el recuento del total de elementos cargados 
  var agregarElementosCargados = 3; //Marca el ritmo de publicaciones que se van agregando a medida que el usuario las va viendo
  var ultimaPublicacion; //Se define la variable que contiene el ultimo elemento de la publicacion, este elemento cambia a medida que se cargan los objetos, util para el LazyLoad

  function buscarProductos() {
    setTimeout(function () {
      //Genera un pequeño retraso simulando la comunicacion que hay con el servidor

      fetch("baseProductos.txt").then(function (res) {
        if (!res.ok) {
          throw new Error("No se pudo acceder a la base de datos correctamente");
        } else {
          return res.json();
        }
      }).then(function (productos) {
        productosDB = productos;
        cargarProductos(productosDB, cargaInicial); //Carga los primeros elementos
      })["catch"](function (error) {
        console.log(error);
      });
    }, Math.random() * 1000);
  }
  ;
  function cargarProductos(producto, cargaHasta) {
    var contenedorProductos = document.getElementById('catalogo'); //Toma el catalogo como el contenedor de los productos a agregar
    var fragmento = document.createDocumentFragment(); //Crea un fragmento para alojar todos los elementos antes de agregarlos al catalogo
    var agregarElemento;
    for (var i = elementosCargados; i < cargaHasta; i++) {
      // Agrega todos los elementos al fragmento
      agregarElemento = document.createElement('div');
      if (producto[i].cantidad > 0) {
        agregarElemento.innerHTML = "\n            <div class=\"catalogo__div\" id=\"".concat(producto[i].id, "\" data-imagen1=\"").concat(producto[i].imagen, "\" data-nombre=\"").concat(producto[i].nombre, "\" data-precio=\"$ ").concat(producto[i].precio, "\">\n            <div class=\"catalogo__div__imagen\" style='background-image: url(\"").concat(producto[i].imagen, "');\"></div>\n            <h2 class=\"catalogo__div__nombre\">").concat(producto[i].nombre, "</h2>\n            <h3 class=\"catalogo__div__precio\">$ ").concat(producto[i].precio, "</h3>\n            <button class=\"catalogo__div__comprar\">Agregar al carro</button>\n            </div>\n            ");
      } else {
        agregarElemento.innerHTML = "\n            <div class=\"catalogo__div\" id=\"".concat(producto[i].id, "\" data-imagen1=\"").concat(producto[i].imagen, "\" data-nombre=\"").concat(producto[i].nombre, "\" data-precio=\"$ ").concat(producto[i].precio, "\">\n            <div class=\"catalogo__div__imagen\" style='background-image: url(\"").concat(producto[i].imagen, "');\"></div>\n            <h2 class=\"catalogo__div__nombre\">").concat(producto[i].nombre, "</h2>\n            <h3 class=\"catalogo__div__precio\">$ ").concat(producto[i].precio, "</h3>\n            <button class=\"catalogo__div__comprar catalogo__div__comprar-noDisponible\">No disponible</button>\n            </div>\n            ");
      }
      elementosCargados++;
      fragmento.appendChild(agregarElemento); //Agrega el producto recien creado al fragmento
    }
    ;
    contenedorProductos.appendChild(fragmento); //Agrega el fragmento con todos los productos al catalogo

    ultimaPublicacion = document.getElementById("catalogo").lastElementChild; //Define cual es el ultimo elemento del catalogo
    lazyLoad();

    //Se agrega el comportamiento de cuando se hace click sobre cualquier producto

    //Se configura el comportamiento de la ventana
    var productosCargados = document.querySelectorAll('.catalogo__div');
    var visualizarProducto = document.getElementById("catalogoProducto");
    var catalogo__fondo = document.getElementById("catalogo__fondo");
    var catalogoProducto__imagen = document.getElementById("catalogoProducto__imagen");
    productosCargados.forEach(function (producto) {
      producto.addEventListener("click", function () {
        document.getElementById("catalogoProducto__titulo").textContent = producto.dataset.nombre; //Titulo del producto seleccionado
        document.getElementById("catalogoProducto__precio").textContent = producto.dataset.precio; //Precio del producto seleccionado
        catalogoProducto__imagen.style.backgroundImage = "url(\"".concat(producto.dataset.imagen1, "\")"); //Imagen del producto seleccionado
        visualizarProducto.classList.toggle("catalogoProducto-active");
        catalogo__fondo.classList.toggle("catalogo__fondo-active");
      });
    });
    function salirCatalogo() {
      //Funcion para volver al catalogo
      catalogo__fondo.classList.toggle("catalogo__fondo-active");
      visualizarProducto.classList.toggle("catalogoProducto-active");
    }
    var catalogoProducto__salir = document.getElementById("catalogoProducto__salir");
    catalogoProducto__salir.addEventListener("click", function () {
      salirCatalogo();
    }); //Comportamiento de el boton de salir
    catalogo__fondo.addEventListener("click", function () {
      salirCatalogo();
    }); //Comportamiento del fondo
  }

  //LazyLoad (Carga los elementos segun el usuario los este por ver)
  function lazyLoad() {
    var callback = function callback(entries) {
      if (entries[0].isIntersecting) {
        if (productosDB.length >= elementosCargados + agregarElementosCargados) {
          cargarProductos(productosDB, elementosCargados + agregarElementosCargados);
        } else if (productosDB.length > elementosCargados) {
          cargarProductos(productosDB, productosDB.length);
        } else if (productosDB.length == elementosCargados) {
          console.log("Se ha completado la carga de los productos");
        } else {
          console.log("Se ha producido un error");
        }
      }
    };
    var observador = new IntersectionObserver(callback);
    observador.observe(ultimaPublicacion);
  }
  buscarProductos();
});
